C.aRM=new L.C("These settings are not Flexfold or even demo app related, they show how you can enrich your app with a few settings that can be helpful during development and testing.\n\nPlatform mechanics change how the user interface behaves. You can make text editing and scrolling on an Android device behave like on an Apple device and wise versa. Normally you would leave this at the used platform value, but if you for example prefer using iOS scrolling physics on Android, feel free to switch. Changing this setting is mostly useful for testing.\n\nNormally the device locale would change the LTR and RTL text direction and layout of the program. This simple demo uses no locale, but it can wrap itself with a given Directionality. You can use this to test and verify how the layout of Flexfold also changes with RTL directionality.",null,null,null,null,null,null,null,null)
C.aIO=new T.D(C.a0,C.aRM,null)
C.aPg=new L.C("You can modify the breakpoint for when the switch between each navigation type occurs. The breakpoints also function as constraints for available navigation modes when users manually toggle between them. The current screen width and height is shown in the app bar in this demo, you can use it to observe that changes occur at set breakpoints.\n\nThe default breakpoint values work well for most devices and applications, but you can also adjust them via properties in FlexfoldThemeData. This demo allows you to adjust the breakpoints interactively to try the layout with other values.",null,null,null,null,null,null,null,null)
